// must consume \n as last character
TL_LexOut tl_lexer_read_token(char* input, int offset, int length) {
    TL_LexOut output;
    input += offset;
    output.start = offset;
    int i = 0;
    int* state = edges[1];
    while (i < length) {
        unsigned char c = (unsigned char) input[i++];
        int result = state[c];
        // printf("%d: %c: %d\n", i, c, result);
        if (result == 0) {
            output.offset = offset + i;
            output.type = ERROR;
            return output;
        }
        if (result == WHITESPACE) {
            output.start++;
            continue;
        }
        if (result > 255) {
            i--;
            output.offset = offset + i;
            output.type = result;
            return output;
        }
        state = edges[result];
    }
    output.type = NOP;
    output.offset = offset + length;
    return output;
}